import React from "react";
import { movieArr } from "./data";
import CardMovieModel from "./CardMovieModel";

export default function ListCardMovieItem() {
  const renderListCardMovie = () => {
    return movieArr.map((movie) => <CardMovieModel movie={movie} />);
  };

  return <div className="row">{renderListCardMovie()}</div>;
}
